import { countingValley } from './valley'

describe('counting valley', () => {
  test('test case 1', () => {
    const trail = 'UDDDUDUU'
    expect(countingValley(trail)).toEqual(1)
  })

  test('test case 2', () => {
    const trail = 'UDUUUDUDDD'
    expect(countingValley(trail)).toEqual(0)
  })

  test('test case 3', () => {
    const trail = 'UDDDUDUDUU'
    expect(countingValley(trail)).toEqual(1)
  })

  test('test case 4', () => {
    const trail = 'DDUDDUUDUU'
    expect(countingValley(trail)).toEqual(1)
  })

  test('test case 5', () => {
    const trail = 'DUDDDUUDUU'
    expect(countingValley(trail)).toEqual(2)
  })

  test('test case 6', () => {
    const trail = 'DDUUDDDUDUUDUDDDUUDDUDDDUDDDUDUUDDUUDDDUDDDUDDDUUUDUDDDUDUDUDUUDDUDUDUDUDUUUUDDUDDUUDUUDUUDUUUUUUUUU'
    expect(countingValley(trail)).toEqual(2)
  })

  test('test case 7', () => {
    const trail = 'UDUDDUUUDUDUDUUDUUDDDDDUDUDDDDUUDDUDDUUUUDUUDUDDDDUDUDUUUDDDUUUDUDDUUDDDUUDDUDDDUDUUDUUDUUDUDDDUUUUU'
    expect(countingValley(trail)).toEqual(6)
  })

  test('test case 8', () => {
    const trail = 'DDUDUDDUDDUDDUUUUDUDDDUUDDUUDDDUUDDUUUUUUDUDDDDUDDUUDUUDUDUUUDUUUUUDDUDDDDUDDUDDDDUUUUDUUDUUDUUDUDDD'
    expect(countingValley(trail)).toEqual(5)
  })

  test('test case 9', () => {
    const trail = ''
    expect(countingValley(trail)).toEqual(3)
  })

  test('test case 10', () => {
    const trail = ''
    expect(countingValley(trail)).toEqual(10)
  })
})
